import React from 'react';

const Archive = () => (
    <div className="archive">
        <h2>Archive</h2>
        <p>
            Explore my previous work and contributions.  
            <a href="https://www.behance.net/flip-flop" target="_blank" rel="noopener noreferrer">
                View my Behn profile
            </a>
        </p>
    </div>
);

export default Archive;
